import React from "react";

const Table = props => {
  let tableBody;
  if (props.weather.length) {
    let days = ["Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday"];
    let tableRows = props.weather.map(weather => {

      let day = days[new Date(weather.applicable_date).getDay()];
      return (
        <tr key={weather.id}>
          <td>{weather.weather_state_name}</td>
          <td>{day}</td>
        </tr>
      );
    });

    tableBody = <tbody>{tableRows}</tbody>;
  }

  return (
    <table>
      <thead>
        <tr>
          <th>Condition</th>
          <th>Day</th>
          <th>Location</th>
          <th>Humidity</th>
        </tr>
      </thead>
      {tableBody}
    </table>
  );
};

export default Table;
